import { configureStore } from "@reduxjs/toolkit";
import authReducer from "./authSlice"; // Import other reducers if you have them.
import darkThemeReducer from "./darkThemeSlice";

const store = configureStore({
  reducer: {
    auth: authReducer, // Add other reducers if needed.
    darkTheme: darkThemeReducer, // Make sure you have included the darkThemeReducer.
  },
});

export default store;
